import React from 'react';
import { Grid } from '@material-ui/core';

const data = [
  {
    "title": "Corona Tracker(Web Application & Hybrid App)",
    "category": "",
    "image": "Covid.png",
    "url": "coronatracker19-a6553.web.app"
  },
  {
    "title": "Real-Time-Chat-App",
    "category": "",
    "image": "chat.png",
    "url": "https://github.com/mustafahaider508/Real-Time-Chat-App"
  },
  {
    "title": "Tesla-clone WEB APPLICATION",
    "category": "",
    "image": "Tesla.png",
    "url": "https://github.com/mustafahaider508/Tesla-clone"
  },
  {
    "title": "Slack",
    "category": "",
    "image": "Slack.png",
    "url": "https://github.com/mustafahaider508/Amazon-clone"
  },
  {
    "title": "Slack",
    "category": "",
    "image": "Slack.png",
    "url": "https://github.com/mustafahaider508/Amazon-clone"
  },
  {
    "title": "Amazon-clone",
    "category": "",
    "image": "Amazon.png",
    "url": "https://github.com/mustafahaider508/Amazon-clone"
  }

]

function Portfolio() {
  return (
    <>
    <div>
      <h1>PROJECTS</h1>
      <p>my some Works</p>
       <Grid container spacing={1}>
            {data.map((i) =>
            <Grid item  md={4} sm={12} xs={12}>
              <p>{i.title}</p>
              <img src={i.image} alt="" />
              <button link={i.url}></button>

           </Grid>
           )}
            </Grid>
            <img src="Slack.png" />

    </div>

    </>
  )
}

export default Portfolio
